import React, { useState } from 'react';
import './Login.css';

export default function LoginV() {
  const [formType, setFormType] = useState('login');

  return (
    <div className="form-container">
      <h1>{formType === 'login' ? 'Login' : 'Register'}</h1>
      <form>
        <label>
          Email
          <input type="email" placeholder="email" />
        </label>
        <label>
          Password
          <input type="password" placeholder="password" />
        </label>
        {formType === 'register' && (
          <label>
            Confirm Password
            <input type="password" placeholder="confirm password" />
          </label>
        )}
        <button type="submit">{formType === 'login' ? 'Login' : 'Register'}</button>
        <button type="button" onClick={() => setFormType(formType === 'login' ? 'register' : 'login')}>
          Switch to {formType === 'login' ? 'register' : 'login'}
        </button>
      </form>
    </div>
  );
}
